import React from 'react';
import {Text, View, Button,StyleSheet} from 'react-native';


const Login = ({ navigation }) =>{
    return(
        <View style={styles.container}>
            <Text>Hello</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        justifyContent:'center',
        height:'100%',
        flex:1,
        backgroundColor:'red'

    },
});


export default Login;
